import React, { Component } from 'react';

export default class Header extends Component {
  render() {
    return (
      <div
        style={{
          color: 'white',
          backgroundColor: '#BD574E',
          boxShadow: '0.1em 0.1em #dedef0',
          padding: '0.5em',
          display: 'inline-block',
        }}
      >
        {this.props.children}
      </div>
    );
  }
}
